import React from "react";
import Songlibrary from './Songlibrary'
function Songcollection({songs,  setcurrentsong ,isplaying, setisplaying ,audioRef}){
		
	

		return(
		
		
		<div class="libray">
		<h1>libray</h1>
		<div className="library_songs">
		{
			songs.map((song) => <Songlibrary  audioRef ={audioRef }  setcurrentsong={ setcurrentsong} isplaying={isplaying} setisplaying={setisplaying} song={song} />
			
			
		)
			
		}
		</div>
		
		</div>
		
		
		
		
		)
		
		
		
	}



export default Songcollection
